export default function Services() {
  return (
    <section id="services">
      <h2>Our Services</h2>
      <div>
        <h3>Wedding Planning</h3>
        <p>End-to-end wedding planning tailored to your vision.</p>

        <h3>Photography</h3>
        <p>Capture every moment with our professional photographers.</p>

        <h3>Decoration</h3>
        <p>Beautiful, custom-themed decor for every ceremony.</p>
      </div>
    </section>
  );
}
